static char FindTheDifference(string s, string t)
{

    List<char> list2 = new List<char>(t);
    for (int i = 0; i < s.Length; i++)
    {
        char c = s[i];
        if (list2.Contains(c))
        {
            list2.Remove(c);
        }
    }

    return list2[0];
}

